import {
    makeStyles
} from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    button: {
        margin: theme.spacing(1),
        padding: theme.spacing(1),
    },
    divContainer: {
        margin: 0,
    }
}));

export default useStyles;
